@FILE705.text:
//***FILE 705 is from David Cartwright and contains some tools      *   FILE 705
//*           to do performance tuning on a Flex-ES machine which   *   FILE 705
//*           is running z/OS.  These tools use TSSO console        *   FILE 705
//*           automation from File 404 of the CBT Tape.             *   FILE 705
//*                                                                 *   FILE 705
//*           email:  davecartwright@uk.agcocorp.com                *   FILE 705
//*                                                                 *   FILE 705
//*    A description of the content of this file follows:           *   FILE 705
//*                                                                 *   FILE 705
//*     This file illustrates some of the work done at AGCO UK      *   FILE 705
//*     Coventry to use TSSO from file 404 for the CBT tape to      *   FILE 705
//*     control an MVS system running under Flex-ES.  The           *   FILE 705
//*     members start with;                                         *   FILE 705
//*                                                                 *   FILE 705
//*     TIMER - this is the main clist which drives the other       *   FILE 705
//*     members. This is invoked by AOF processing by some          *   FILE 705
//*     message which appears at fixed intervals.  I have two       *   FILE 705
//*     main threads driven by this clist;                          *   FILE 705
//*                                                                 *   FILE 705
//*     PERFORMANCE MEASUREMENT                                     *   FILE 705
//*     =======================                                     *   FILE 705
//*     We were moving production off an IBM Multiprise 2003        *   FILE 705
//*     which had an excess of MIPS and which had a good disk       *   FILE 705
//*     subsystem of an EMC Symmetrix on four ESCON channels.       *   FILE 705
//*     Our IMS response times were variable and our overnight      *   FILE 705
//*     BMP jobs had very elongated run times.  These               *   FILE 705
//*     applications are very cache unfriendly, but the EMC box     *   FILE 705
//*     had so much cache it didn't matter.  We started to          *   FILE 705
//*     monitor the Flex-ES cachestatistics for our disk            *   FILE 705
//*     controllers.  Our best bet would be to scrap the            *   FILE 705
//*     individual track caches and assign cache at the Control     *   FILE 705
//*     Unit level.  This is then shared out by Flex-ES as          *   FILE 705
//*     demand requires.  I continue to collect Flex-ES cache       *   FILE 705
//*     statistics, although I now rarely bother to look at         *   FILE 705
//*     them.  The TSSO members used for this activity are;         *   FILE 705
//*                                                                 *   FILE 705
//*     CONFIG - Our Flex-ES configuration file which can be        *   FILE 705
//*     tied to the other stuff.  It illustrates our cache          *   FILE 705
//*     definitions.                                                *   FILE 705
//*                                                                 *   FILE 705
//*     CACHE - Every hour this TSSO clist runs commands on the     *   FILE 705
//*     Flex-ES system to collect Flex-ES cachestatistics for       *   FILE 705
//*     every disk controller defined in the config file and        *   FILE 705
//*     appends them to a Unixware file.                            *   FILE 705
//*                                                                 *   FILE 705
//*     FLEXJ01 - is a batch job that TIMER submits just before     *   FILE 705
//*     midnight each day.  It takes a snapshot of Unixware         *   FILE 705
//*     memory usage over the last 24 hours which is appended       *   FILE 705
//*     to the cachestatistics file.  This file is then FTP'd       *   FILE 705
//*     over to a mainframe GDG so I have a history that I can      *   FILE 705
//*     browse from ISPF.                                           *   FILE 705
//*                                                                 *   FILE 705
//*     REPORT - is a sample output from FLEXJ01.                   *   FILE 705
//*                                                                 *   FILE 705
//*     RESET - a clist which is called at the end of FLEJ01 to     *   FILE 705
//*     write an end-of-file at the start of the cachestastics      *   FILE 705
//*     file ready to collect another day's worth of data.          *   FILE 705
//*                                                                 *   FILE 705
//*     STORAGE MANAGEMENT                                          *   FILE 705
//*     ==================                                          *   FILE 705
//*     Another function of TIMER is to automate various HSM        *   FILE 705
//*     housekeeping commands such as DELVOL.                       *   FILE 705
//*     The Storage Management members are;                         *   FILE 705
//*                                                                 *   FILE 705
//*     STORAGE - This clist monitors the non-SMS disks and         *   FILE 705
//*     switches them from STORAGE to PRIVATE if they get too       *   FILE 705
//*     full and vice-versa as they empty.                          *   FILE 705
//*                                                                 *   FILE 705
//*     SYSDA - this REXX uses the VTOC command off the CBT         *   FILE 705
//*     tape to monitor allocations on a few disks that I           *   FILE 705
//*     called SYSDA.                                               *   FILE 705
//*                                                                 *   FILE 705

FLEXJ01.text:
//MMSMAKFT JOB (TR,UKM,T,250,00000),'DAVID CARTWRIGHT....',CLASS=G,
//         MSGCLASS=V,TIME=30,REGION=0M
//*
//*      PDSDOC *FLEX CACHE STATISTICS - GET, SAVE, CLEAR.............*
//*
//SAR     EXEC PGM=IKJEFT01
//SYSABEND DD  SYSOUT=*
//SYSPRINT DD  SYSOUT=*
//SYSTSPRT DD  SYSOUT=*
//SYSPROC  DD  DISP=SHR,DSN=SYS1.TSSO43.CLIST
//SYSTCPD  DD  DISP=SHR,DSN=TCPIP.CNTL(TCP1DATA)
//SYSTSIN  DD  *
 REXEC -l flexes -p abcdef1 180.7.16.36 sar -r  >> /scratch3/cache.txt
/*
//*
//GET     EXEC PGM=FTP
//SYSPRINT DD  SYSOUT=*
//SYSUDUMP DD  SYSOUT=*
//OUTPUT   DD  SYSOUT=*
//INPUT    DD  *
  180.7.16.36
  userid
  xxxxx
  cd /scratch3
  GET cache.txt 'OPS.FLEX.STATS'
  QUIT
/*
//SYSFTPD  DD  *
;
;
; File and disk parameters
;
PRIMARY         75         ; PRIMARY ALLOCATION IN TRACKS
SECONDARY       30         ; SECONDARY ALLOCATION IN TRACKS
LRECL           133        ; LOGICAL RECORD LENGTH IS 80  BYTES
BLOCKSIZE       23476      ; BLOCK SIZE IS 3120 FOR UNLOADED PDS
AutoRecall      true       ; Migrated HSM files recalled automatically
AutoMount       false      ; Nonmounted volumes auto mount - no
DirectoryMode   false      ; Use all qualifiers (Datasetmode)
;Volume         volume     ; Volume serial number for allocation
SpaceType       TRACK      ; Data sets allocated in tracks
RECFM           VB         ; RECORD FORMAT
;DcbDSN         model.dcb  ; Data set name used as model for allocation
UNITNAME       DISK        ; UNIT NAME USED FOR ALLOCATION
Filetype        SEQ        ; File Type = SEQ (default)
;RETPD           30         ; New data set expiration date is 30 days
RETPD           00         ; New data set expiration date is 00 days
RDW             false      ; Do not retain RDWs as data
NCP             15         ; 15 I/O buffers
/*
//SYSTCPD  DD  DISP=SHR,DSN=TCPIP.CNTL(PROFILE1)
//*
//SAVE    EXEC PGM=IEBGENER
//SYSPRINT DD  SYSOUT=*
//SYSIN    DD  DUMMY
//SYSUT1   DD  DISP=(OLD,DELETE,KEEP),DSN=OPS.FLEX.STATS
//SYSUT2   DD  DISP=(,CATLG),UNIT=DISK,
//             DCB=(BBS.MODEL.DSCB,RECFM=VB,LRECL=133,BLKSIZE=0),
//             MGMTCLAS=SMF,STORCLAS=STANDARD,DATACLAS=MINIMUM,
//             SPACE=(TRK,(100,50),RLSE),
//             DSN=OPS.FLEX.CACHE(+1)
//*
//CLEAR   EXEC PGM=IKJEFT01
//SYSABEND DD  SYSOUT=*
//SYSPRINT DD  SYSOUT=*
//SYSTSPRT DD  SYSOUT=*
//SYSPROC  DD  DISP=SHR,DSN=SYS1.TSSO43.CLIST
//SYSTCPD  DD  DISP=SHR,DSN=TCPIP.CNTL(TCP1DATA)
//SYSTSIN  DD  *
 %RESET
/*

RESET.text:
PROC 0 DEBUG
 /*                                                                  */
 /*      PDSDOC *TSSO CLIST TO RESET  FLEXES CACHE RECORD............*/
 /*                                                                  */
  IF &DEBUG = DEBUG THEN CONTROL MSG LIST CONLIST SYMLIST FLUSH ASIS
                    ELSE CONTROL NOMSG NOLIST FLUSH ASIS
 /*                                                                  */
 /* HERE IS REXEC CODE TO PERFORM FLEXES FUNCTIONS ON SERVER         */
 /*                                                                  */
 REXEC -l flexes -p abcdef1 180.7.16.36 echo  +
        "RESET AT " &SYSTIME " ON " &SYSDATE  > /scratch3/cache.txt
  SET RC1 = &LASTCC
  IF &RC1 NE 0 THEN OSWTO FLEX HAD RC1 &RC1
 /*                                                                  */
  EXIT CODE(0)
 /*                                                                  */

SYSDA.text:
    /* REXX */
  /*   TRACE ALL                                                     */
  /*                                                                 */
  /*     PDSDOC *DELETE TEST DATASETS FROM SYSDA DISKS.............. */
  /*                                                                 */
  /* This exec was written to handle the way that AGCO use the       */
  /* esoteric name 'SYSDA' for files with non-temporary names, but   */
  /* which must not be kept permanently. In order to meet the Users' */
  /* expectations that such files will be deleted daily this exec    */
  /* uses the VTOC command (see CSOFT.VTOC.ASM) to list test files   */
  /* on the SYSDA disks then deletes them. If they are not cataloged */
  /* additional processing is incurred to use Allocation to scratch  */
  /* the dataset.                                                    */
  /*                                                                 */
  /* 12Mar01 DHC Wrote to replace batch job outlawed by Scheduling. */
  /*                                                                 */
  /*                                                                 */
    "DELETE 'MMS.VTOC.OUTPUT'"
    "ALLOC FI(VTOCOUT) SPACE(5 1) TRACKS UNIT(SYSSQ)",
         "DA('MMS.VTOC.OUTPUT') NEW CATALOG REUSE"
    "VTOC (E91A8 ) CAT NOHEADING  LEVEL(CDU CDT CDW MMS MYY)",
         "PRINT(NEW (DSNAME VOLUME CAT))"
 read_RC = 0        /* clear return code   */
    "EXECIO * DISKR VTOCOUT(STEM dataset. FINIS"  /*read vtoc report */
 if rc = 0 then do
  do i = 1 to dataset.0         /* loop thru vtoc records   */
     PARSE VAR dataset.i dsn vol cat
     if vol = TOTALS then leave
     else do
     if cat = C then "DELETE '"dsn"'"
       else do
       "ALLOC DA('"dsn"') FI("vol") UNIT(SYSALLDA) VOL("vol,
              ") SHR DELETE REUSE"
       "FREE FI("vol")"
       end
     end
  end
    "FREE FI(VTOCOUT)"
 end
 else do              /* read failed */
 read_RC = RC
 say "EXECIO error RC ="read_RC
end
